import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router'; // Import ActivatedRoute to access route parameters

@Component({
  selector: 'app-deminscri',
  templateUrl: './deminscri.component.html',
  styleUrls: ['./deminscri.component.css']
})
export class DeminscriComponent implements OnInit {
  item: string | null = null; // Variable to hold the route parameter

  constructor(private route: ActivatedRoute) {}

  ngOnInit(): void {
    // Get the 'item' parameter from the route
    this.item = this.route.snapshot.paramMap.get('mapping-request');
    console.log('Item from route:', this.item);
  }
}
